import { https, logger, config } from 'firebase-functions'
import { firestore } from 'firebase-admin'

import axios from 'axios'

// id: originalTransactionIdentifierIOS
const onCallRequestSubscription = https.onRequest(async (req: any, res: any) => {
  const id = req.body?.data?.id
  const uid = req.body?.data?.uid
  try {
    const iapRef = firestore().doc(`/iap/${id}`)
    const iap = await iapRef.get()
    if (!iap.data()?.uid) {
      await iapRef.update({
        uid: uid,
      })
    }
    logger.info('CHECK DATA REQUEST', id)
    if (iap.data()?.password) {
      logger.info('IAP pass', iap.data()?.password)
      return axios({
        method: 'post',
        url: config().apple.hook, //'https://sandbox.itunes.apple.com/verifyReceipt',
        data: {
          'receipt-data': req.body?.data?.receipt,
          password: iap.data()?.password,
        },
      }).then(async (response) => {
        logger.log('IAP response', response.data)
        if (response.data.receipt) {
          const userRef = firestore().doc(`/users/${iap.data()?.uid || uid}`)

          await userRef?.update({
            subscription: {
              status: true,
              product: response.data.receipt.in_app[0].product_id,
              expires_date_ms: response.data.receipt.in_app[0].expires_date_ms,
              original_transaction_id: response.data.receipt.in_app[0].original_transaction_id,
            },
          })

          res.status(200).json({
            success: true,
            data: {
              receipt_creation_date_ms: response.data.receipt.receipt_creation_date_ms,
              transaction_id: response.data.receipt.in_app[0].transaction_id,
            },
          })
          return
        } else {
          res.status(500).json({
            success: false,
            message: `Error Validate Receipt ${id}`,
          })
          return
        }
      })
    } else {
      res.status(500).json({
        success: false,
        message: `Error Validate Receipt ${id}, Password not found`,
      })
    }
  } catch (e) {
    logger.error(`Error Receipt ${id}`, e)
    return res.status(500).json({
      success: false,
      message: `Error Validate Receipt ${id}`,
    })
  }
})

